using System;

namespace Netnr.TencentAI.Test
{
    public class Vision
    {
        /// <summary>
        /// 图片识别>看图说话
        /// </summary>
        /// <returns></returns>
        public static string Vision_ImgToText()
        {
            var mo = new Model.Vision_ImgToTextRequest
            {
                image = "",
                session_id = Guid.NewGuid().ToString("N")
            };

            var result = fcgi_bin.Vision.Vision_ImgToText(mo);
            return result;
        }

        /// <summary>
        /// 图片识别>场景识别
        /// </summary>
