        public static string Vision_Scener()
        {
            var mo = new Model.Vision_ScenerRequest
            {
                image = ""
            };

            var result = fcgi_bin.Vision.Vision_Scener(mo);
            return result;
        }

        /// <summary>
        /// 图片识别>场景识别（场景标识定义）
        /// </summary>
        /// <returns></returns>
        public static string Vision_Scener_Label()
        {
            return Static.Dic.Vision_Scener_Label();
        }

        /// <summary>
        /// 图片识别>物体识别
        /// </summary>
