        public static string Vision_Objectr()
        {
            var mo = new Model.Vision_ObjectrRequest
            {
                image = ""
            };

            var result = fcgi_bin.Vision.Vision_Objectr(mo);
            return result;
        }

        /// <summary>
        /// 图片识别>物体识别（物体标识定义）
        /// </summary>
        /// <returns></returns>
        public static string Vision_Objectr_Label()
        {
            return Static.Dic.Vision_Objectr_Label();
        }
    }
}

